        console.log('moreinfo');
        var curEl = evt.currentTarget;
        console.log(evt);
        curEl.setHTML('Handmade Arlington purse. Made from fine linin from Italy. Only 1 up for aution! <a class="url" href="http://theboytrifecta.com/2011/09/arlington-bag.html">theboytrifecta.com/<span class="ddd">...</span><span class="urlTail">2011/09/arlington-bag.html</span></a>');
